Interfaces are a way to specify a contract that defines the methods that an object must implement, but not their implementation. To implement interfaces in a C# class, you can use the keyword "interface" to define an interface and the keyword "implements" to indicate that a class implements an interface.

Here's an example:
```
interface IExample
{
    void Method1();
    int Method2();
}

class ExampleClass : IExample
{
    public void Method1()
    {
        Console.WriteLine("Method1 in ExampleClass");
    }
    public int Method2()
    {
        Console.WriteLine("Method2 in ExampleClass");
        return 0;
    }
}
```
In this example, we have an interface `IExample` that defines two methods, `Method1` and `Method2`. The `ExampleClass` class implements the `IExample` interface, so it must provide a concrete implementation for the methods defined in the interface.

A class can implement multiple interfaces by separating them with a comma in the class definition:
```
class ExampleClass : IExample, IAnotherExample
```
By using interfaces, you can define a contract that specifies the methods that an object must implement, but not their implementation, it allows for the implementation details of an object to be hidden while still exposing the necessary information to the outside world. It also allows objects of different classes to be treated as objects of a common interface, which facilitates the use of polymorphism.

