1. Create a secret in Google Cloud Secrets Manager with your database connection string.
2. Install the `@google-cloud/secret-manager` package:
```bash
npm install @google-cloud/secret-manager
```
1. Use the `SecretManagerServiceClient` class to retrieve your secret value:
```javascript
const { SecretManagerServiceClient } = require('@google-cloud/secret-manager');

async function getDatabaseConnectionString() {
  const client = new SecretManagerServiceClient();
  const [version] = await client.accessSecretVersion({
    name: 'projects/YOUR_PROJECT_ID/secrets/YOUR_SECRET_NAME/versions/latest',
  });
