    private $dataType;
    private $value;

    public function __construct($name, $dataType, $value = null)
    {
        $this->name = $name;
        $this->dataType = $dataType;
        $this->value = $value;
    }

    public function setValue($value)
    {
        if ($this->validateDataType($value)) {
            $this->value = $value;
            return true;
        }
        return false;
