```javascript
#!/usr/bin/env node

const fs = require('fs');
const path = require('path');
const glob = require('glob');

// get the glob pattern from the command line arguments
let globPattern = process.argv[2];

// construct an absolute file path based on the current working directory
const absoluteDir = process.cwd();

// define a regular expression for replacing Thai numerals with Arabic numerals
const numeralRegex = /[๐-๙]/g;

// define a lookup table for Thai to Arabic numerals
const numeralTable = {
  '๐': '0',
  '๑': '1',
  '๒': '2',
  '๓': '3',
  '๔': '4',
  '๕': '5',
  '๖': '6',
  '๗': '7',
  '๘': '8',
  '๙': '9'
};

// expand the glob pattern into an array of file paths
glob(globPattern, { cwd: absoluteDir }, (err, files) => {
  if (err) {
    console.error(err);
    return;
  }

  // process each file in the array
  files.forEach(file => {
    // construct an absolute file path based on the file path in the array
    const absolutePath = path.resolve(absoluteDir, file);

    try {
      // use the fs module to read the contents of the file synchronously
      const data = fs.readFileSync(absolutePath, 'utf8');

      // replace all Thai numerals with their Arabic equivalents
      const arabicData = data.replace(numeralRegex, match => numeralTable[match]);

      // use the fs module to write the modified contents back to the same file
      fs.writeFileSync(absolutePath, arabicData, 'utf8');
      console.log(`File ${absolutePath} saved.`);
    } catch (err) {
      console.error(err);
    }
  });
});
```
In this updated version of the script, we added a shebang line at the beginning (`#!/usr/bin/env node`) to allow the script to be executed as a standalone command. We also modified the `numeralTable` variable to use a regular expression (`numeralRegex`) to match all Thai numerals (`/[๐-๙]/g`), and we replaced the loop that used the `numeralTable` object with a single call to the `replace()` method using the `numeralRegex`.

With these modifications, the script should work with a glob pattern to process all matching files in a directory.

