```java
public class InventoryManager {
    public static void decreaseInventory(Id productId, Integer quantity) {
        // Retrieve the Product2 record
        Product2 product = [SELECT Id, Name, StockKeepingUnit, QuantityOnHand, ReorderPoint FROM Product2 WHERE Id = :productId];

        // Check if there is enough quantity on hand
        if (product.QuantityOnHand >= quantity) {
            // Decrease the quantity on hand
            product.QuantityOnHand -= quantity;
            update product;
        } else {
            // Throw an exception if there is not enough quantity on hand
            throw new InventoryException('Not enough quantity on hand for product ' + product.Name);
        }
    }

    public static void increaseInventory(Id productId, Integer quantity) {
        // Retrieve the Product2 record
        Product2 product = [SELECT Id, Name, StockKeepingUnit, QuantityOnHand, ReorderPoint FROM Product2 WHERE Id = :productId];

        // Increase the quantity on hand
        product.QuantityOnHand += quantity;
        update product;
    }
}

// Custom exception for inventory management
global class InventoryException extends Exception {}
