    function trackVisit(item) {
      if (visits[item]) {
        visits[item]++;
      } else {
        visits[item] = 1;
      }
    }

    // Function to sort the items by number of visits
    function sortItemsByVisits() {
      items.sort(function(a, b) {
        if (visits[b] === visits[a]) {
          return 0;
        }
        return visits[b] > visits[a] ? 1 : -1;
      });
    }

    // Function to display the items
    function displayItems() {
      var itemList = document.getElementById("item-list");
      itemList.innerHTML = "";
      for (var i = 0; i < items.length; i++) {
