The error message "Could not establish connection. Receiving end does not exist." usually indicates that the extension is trying to send a message to a tab or a content script that is not currently available.

One possible reason for this error is that the tab or content script was closed or destroyed before the message was sent. Another reason could be that the message was sent before the content script finished loading, or before the tab was fully initialized.

In your case, this error could occur if the content script was not fully initialized before the popup page tries to communicate with it. One way to prevent this error is to wait for the content script to finish loading before sending any messages to it.

Here's an example of how you can modify the `popup.js` script to wait for the content script to finish loading before sending a message to it:
```javascript
document.addEventListener('DOMContentLoaded', function() {
  const captureButton = document.getElementById('captureButton');
  captureButton.addEventListener('click', function() {
    chrome.tabs.query({ active: true, currentWindow: true }, function(tabs) {
      const tab = tabs[0];
      if (!tab) {
        console.error('Unable to capture screenshot: no active tab found.');
        return;
      }

      // inject the content script into the current tab
      chrome.tabs.executeScript(tab.id, { file: 'content.js' }, function() {
        // send a message to the content script when it's loaded
        chrome.tabs.sendMessage(tab.id, { action: 'captureScreenshot' }, function(response) {
          if (chrome.runtime.lastError) {
            console.error(chrome.runtime.lastError.message);
            return;
          }

          // retrieve the default download directory from storage
          chrome.runtime.sendMessage({ action: 'getDownloadDirectory' }, function(response) {
            if (chrome.runtime.lastError) {
              console.error(chrome.runtime.lastError.message);
              return;
            }

            const defaultDirectory = response.downloadDirectory;

            const now = new Date().toISOString();
            const url = new URL(tab.url);
            const invalidChars = /[\\/:"*?<>|]/g;
            const filename = `journey-snap-${url.hostname}-${now.replace(invalidChars, '-')}.png`;

            chrome.downloads.download({
              url: response.screenshotUrl,
              filename: filename,
              saveAs: false,
              conflictAction: 'uniquify',
              directory: defaultDirectory
            }, function(downloadId) {
              if (chrome.runtime.lastError) {
                console.error(chrome.runtime.lastError.message);
                return;
              }

              console.log(`Screenshot downloaded with ID ${downloadId}`);
            });
          });
        });
      });
    });
  });
});
```
In this modified script, we use the `chrome.tabs.executeScript()` method to inject the content script into the current tab. We pass a callback function to this method to be called when the content script finishes loading.

Inside the callback function, we send a message to the content script with `action` set to `'captureScreenshot'`, just as we did before. We then listen for a response from the content script using the `chrome.tabs.sendMessage()` method and retrieve the `screenshotUrl` property from the response.

We then retrieve the default download directory from storage using the `chrome.runtime.sendMessage()` method and save the screenshot file to the default directory, just as we did before.

