      handler: 'index.handler', // Handler: the file and export containing the Lambda function entry point
      code: lambda.Code.fromAsset('path/to/your/lambda/source'), // Path to the source code directory
      memorySize: 256, // Memory allocated to the Lambda function (in MB)
      timeout: cdk.Duration.seconds(10), // Timeout for the Lambda function (in seconds)
      environment: { // Environment variables for the Lambda function
        VAR1: 'value1',
        VAR2: 'value2',
      },
    });
  }
}

const app = new cdk.App();
