Polymorphism:

1. Static polymorphism, also known as compile-time polymorphism, is achieved through method overloading. An example of static polymorphism is having multiple methods with the same name but different parameters in the same class.
```
class MyClass {
    public void print(int x) {
        System.out.println(x);
    }
    public void print(double x) {
        System.out.println(x);
    }
}
```
2. Dynamic polymorphism, also known as runtime polymorphism, is achieved through method overriding. An example of dynamic polymorphism is having a parent class and a child class with a method with the same name and signature, and the child class overrides the parent class method.
```
class Parent {
    public void print() {
        System.out.println("Parent class");
    }
}
class Child extends Parent {
    @Override
    public void print() {
        System.out.println("Child class");
    }
}
```
3. You can achieve dynamic polymorphism by using a reference variable of a parent class to refer to an object of a child class. The parent class reference variable can call the overridden method of the child class at runtime.
```
Parent obj = new Child();
obj.print();  // Output: "Child class"
```
