2. Yes, you can overload constructors in a class by having multiple constructors with different parameter lists.
3. Yes, you can overload static methods in a class by having multiple methods with the same name but different parameter lists.
4. No, final methods cannot be overloaded because they cannot be overridden.
5. To call an overloaded method, you need to use the correct method signature that corresponds to the parameters passed in the method call.

Method overriding:

1. No, private methods of a parent class cannot be overridden by a child class because they have private access level.
2. Yes, a child class can override the abstract methods of its parent class.
3. No, parent class constructors cannot be overridden by a child class.
4. To prevent a parent class method from being overridden by a child class, the method can be declared as final.
5. A private method can only be accessed within the same class, while a final method can be accessed by other classes but cannot be overridden.
6. No, parent class static methods cannot be overridden by a child class.

