class Ledger {
  private balances: Map<string, number>;
  private transactions: Transaction[];

  constructor() {
    this.balances = new Map();
    this.transactions = [];
  }

  // Adds a person to the ledger with a starting balance of 0
  public addPerson(name: string): void {
    this.balances.set(name, 0);
  }

  // Removes a person from the ledger
  public removePerson(name: string): void {
    this.balances.delete(name);
  }

  // Adds an amount to a person's balance and records the transaction
  public addToBalance(name: string, amount: number, description: string): void {
    this.balances.set(name, this.balances.get(name) + amount);
    this.transactions.push({
      type: "ADD",
      name,
      amount,
      description,
    });
  }

  // Subtracts an amount from a person's balance and records the transaction
  public subtractFromBalance(name: string, amount: number, description: string): void {
    this.balances.set(name, this.balances.get(name) - amount);
    this.transactions.push({
      type: "SUBTRACT",
      name,
      amount,
      description,
    });
  }

  // Returns the balance for a person
  public getBalance(name: string): number {
    return this.balances.get(name);
  }

  // Returns the array of transactions
  public getTransactions(): Transaction[] {
    return this.transactions;
  }
}

interface Transaction {
  type: "ADD" | "SUBTRACT";
  name: string;
  amount: number;
  description: string;
}
```
