```js
import questions from './questions.json';

export default async function handler(req, res) {
  // Retrieve the user's tastes from the currentUser variable
  const tastes = currentUser.tastes;

  // Filter the questions based on the user's tastes
  const filteredQuestions = questions.filter((question) => {
    const { key } = question;
    const tasteValue = tastes[key];

    // Return false if the user has already answered the question
    if (tasteValue !== undefined) {
      return false;
    }

    // Check if the question has a false parent
    const keyParts = key.split(".");
    keyParts.pop();
    while (keyParts.length > 0) {
      const parentKey = keyParts.join(".");
      const parentValue = tastes[parentKey];
      if (parentValue === false) {
        return false;
      }
      keyParts.pop();
    }

    // Check if the question has a true sibling
    let hasTrueSibling = false;
    const parentKey = keyParts.join(".");
    const parentValue = tastes[parentKey];
    if (parentValue === true) {
      const siblings = questions.filter((q) => q.key.startsWith(parentKey + ".") && q.key !== key);
      for (const sibling of siblings) {
        if (tastes[sibling.key] === true) {
          hasTrueSibling = true;
          break;
        }
      }
    }

    return !hasTrueSibling;
  });

  // Get the first 5 questions from the filteredQuestions array
  const limitedQuestions = filteredQuestions.slice(0, 5);

  // Return the limited questions in the response
  res.status(200).json({ questions: limitedQuestions });
}
