And update the `fetchAvailableGames` function in the `firestoreService.js` to accept a callback and set up the real-time listener:
```javascript
import { onSnapshot, query, where, orderBy, collection } from 'firebase/firestore';

// ...

export function fetchAvailableGames(callback) {
  const gameQuery = query(
    collection(db, 'games'),
    where('status', '==', 'waiting'),
    orderBy('createdAt')
  );

  const unsubscribe = onSnapshot(gameQuery, (querySnapshot) => {
    const availableGames = [];
    querySnapshot.forEach((doc) => {
      availableGames.push({ ...doc.data(), id: doc.id });
    });
    callback(availableGames);
  });

  // Return the unsubscribe function to clean up the listener
  return unsubscribe;
}
```
Now, the `GamesList` component will automatically update when a new game is created, as it listens to changes in the Firestore collection in real-time. The `unsubscribe()` function returned by the listener is used to clean up the listener when the component is unmounted, preventing memory leaks and unnecessary updates.

