#include <jni.h>
#include <fcntl.h>
#include <sys/mman.h>
#include <android/log.h>

#define  LOG_TAG    "AshmemExample"
#define  LOGI(...)  __android_log_print(ANDROID_LOG_INFO,LOG_TAG,__VA_ARGS__)
#define  LOGE(...)  __android_log_print(ANDROID_LOG_ERROR,LOG_TAG,__VA_ARGS__)

static int ashmem_fd;
static void* ashmem_addr;

extern "C" JNIEXPORT void JNICALL
Java_AshmemExample_createAshmem(JNIEnv* env, jobject thiz, jint size) {
    ashmem_fd = open("/dev/ashmem", O_RDWR);
    if (ashmem_fd < 0) {
        LOGE("Error opening ashmem device");
        return;
    }

    if (ioctl(ashmem_fd, ASHMEM_SET_SIZE, size) < 0) {
        LOGE("Error setting ashmem size");
        return;
    }

    ashmem_addr = mmap(NULL, size, PROT_READ | PROT_WRITE, MAP_SHARED, ashmem_fd, 0);
    if (ashmem_addr == MAP_FAILED) {
        LOGE("Error mapping ashmem to memory");
        return;
    }
}

extern "C" JNIEXPORT void JNICALL
Java_AshmemExample_writeAshmem(JNIEnv* env, jobject thiz, jstring data) {
    const char* data_str = env->GetStringUTFChars(data, NULL);
    sprintf((char*) ashmem_addr, "%s", data_str);
    env->ReleaseStringUTFChars(data, data_str);
}

extern "C" JNIEXPORT jstring JNICALL
Java_AshmemExample_readAshmem(JNIEnv* env, jobject thiz) {
    return env->NewStringUTF((char*) ashmem_addr);
}

extern "C" JNIEXPORT void JNICALL
Java_AshmemExample_closeAshmem(JNIEnv* env, jobject thiz) {
    munmap(ashmem_addr, 1024);
    close(ashmem_fd);
}
