```ocaml
type t = int * string (* Define a new abstract data type t *)

let create x y = (x, y) (* A function to create a value of type t *)

let get_first (x, _) = x (* A function to extract the first element of a value of type t *)

let x = create 1 "foo" (* x has the type int * string *)

let y = get_first x (* y has the type int *)
