```java
using UnityEngine;

public class MoveObject : MonoBehaviour
{
    public float speed = 10.0f;
    public float acceleration = 10.0f;
    public float jumpForce = 10.0f;
    public float cameraLerpSpeed = 10.0f;
    public float cameraRotationSpeed = 10.0f;

    private float currentSpeed = 0.0f;
    private bool isGrounded = false;
    private Camera mainCamera;
    private Vector3 cameraOffset = new Vector3(0, 5, -10);

    private void Start()
    {
        mainCamera = Camera.main;
    }

    // Update is called once per frame
    void Update()
    {
        float horizontal = Input.GetAxis("Horizontal");
        float vertical = Input.GetAxis("Vertical");

        currentSpeed = Mathf.Lerp(currentSpeed, speed, acceleration * Time.deltaTime);

        Vector3 movement = new Vector3(horizontal, 0, vertical) * currentSpeed * Time.deltaTime;
        movement = mainCamera.transform.TransformDirection(movement);
        movement.y = 0;
        transform.position = transform.position + movement;

        if (Input.GetButtonDown("Jump") && isGrounded)
        {
            GetComponent<Rigidbody>().AddForce(Vector3.up * jumpForce, ForceMode.Impulse);
            isGrounded = false;
        }

        float mouseX = Input.GetAxis("Mouse X");
        cameraOffset = Quaternion.AngleAxis(mouseX * cameraRotationSpeed, Vector3.up) * cameraOffset;
        mainCamera.transform.position = Vector3.Lerp(mainCamera.transform.position, transform.position + cameraOffset, cameraLerpSpeed * Time.deltaTime);
        mainCamera.transform.LookAt(transform);
    }

    private void OnCollisionEnter(Collision collision)
    {
        isGrounded = true;
    }
}
```
