        const newValue = event.target.value;
        setValues((prevValues) => ({ ...prevValues, [label]: newValue }));
      };
      return (
        <div key={index}>
          <label>{label}</label>
          <input type={type} value={value} onChange={onChange} />
        </div>
      );
    });
  };

  return (
    <div>
      <h1>Physical Exam</h1>
      {renderForm()}
      <button onClick={handleSave}>Save</button>
    </div>
  );
